import React from 'react';
import Cell from './Cell';


const Row = ( { row, setGrid, setDisable, numberOfCells, setNumberOfCells, numberOfCellsRef }) => {

  return (
    <div style={{display: 'grid', textAlign: 'left', 
                 gridTemplateColumns: '1fr 1fr 1fr 1fr 1fr 1fr 1fr 1fr 1fr 1fr 1fr 1fr 1fr 1fr 1fr 1fr 1fr 1fr 1fr 1fr 1fr 1fr 1fr 1fr 1fr'}}>
      {row.map((cell, j) => {
        return <Cell cell={cell} key={j} 
                     setGrid={setGrid} 
                     setDisable={setDisable}
                     numberOfCells={numberOfCells}
                     setNumberOfCells={setNumberOfCells}
                     numberOfCellsRef={numberOfCellsRef}
                     />
      })}
    </div>
  )
}

export default Row
